import React, {Component} from 'react';
import './RightNav.css';

function showRightNav() {
	this.setState({
		showNav: true
	});
}

function hideRightNav() {
	this.setState({
		showNav: false
	});
}

class RightNav extends Component {
    constructor(props) {
        super(props);

        this.state = {
            showNav : false
        };
    }

    handleClose = () => {
        this.setState({
            showNav : false
        });

    }

    render() {
        return (
            <div className= {this.state.showNav ? "RightNav Show" : "RightNav"} >
	            <div className="Content">
		            <div className="Header">
		            	<a 
		            		className="BackArrow" 
		            		onClick={this.handleClose} />
		        	</div>

	            </div>
	        </div>
        );
    }
}

export default RightNav;
